10 Things I Hate 3: The Real Problem
August 20, 2013
Before they go out on their Valentine's date, Bill stops to talk with Kiara about their (lack of) sex life. Even though he suspects that this talk may lead to a break-up, he thinks it's time they came clean with each other about their feelings. Imagine his surprise when she agrees with him completely and they end up missing their 8 o'clock dinner reservation for something infinitely better!
